import React, { useState } from "react";
import "./Navbar.css";
import chirang_logo from './Chirag_logo.png';

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <nav className="navbar">
      {/* Logo */}
      <div className="logo"><img src={chirang_logo} style={{ width: "100px" }}></img></div>

      {/* Hamburger */}
      <div 
        className={`hamburger ${isOpen ? "open" : ""}`}  // ✅ add `open` class
        onClick={() => setIsOpen(!isOpen)}
      >
        <span></span>
        <span></span>
        <span></span>
      </div>

      {/* Menu */}
      <ul className={isOpen ? "nav-links active" : "nav-links"}>
        <li><a href="/">Course Curriculum</a></li>
        <li><a href="/courses">Pricing</a></li>
        <li><a href="/pricing">Publication</a></li>
        <li><a href="/about">Career Consultation</a></li>
        <li><a href="/about">Our Rewards</a></li>
        <li><button className="btn">Enroll Now</button></li>
      </ul>
    </nav>
  );

};

export default Navbar;
